import React from 'react'
// Sample data for past results
const pastResults = [
    { name: 'Rachna', graduationYear: 2023, occupation: '', location: 'Roorkee, Uttrakhand', profileImage: me },
    { name: 'Ganesh Prajapati', graduationYear: 2017, occupation: 'IIT-Roorkee Student', location: 'Roorkee, Uttrakhand', profileImage: me },
    { name: 'Ganesh Prajapati', graduationYear: 2017, occupation: 'IIT-Roorkee Student', location: 'Roorkee, Uttrakhand', profileImage: me },
    { name: 'Ganesh Prajapati', graduationYear: 2017, occupation: 'IIT-Roorkee Student', location: 'Roorkee, Uttrakhand', profileImage: me },
    { name: 'Ganesh Prajapati', graduationYear: 2017, occupation: 'IIT-Roorkee Student', location: 'Roorkee, Uttrakhand', profileImage: me },
];
function OverPastResult() {
    return (
        <section className="py-12 bg-gray-100 h-full pt-[25%] sm:pt-[15%] md:pt-[10%] ">
        <div className="container mx-auto px-4">
            <h2 className="text-3xl font-semibold text-center mb-8">result</h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
            {pastResults.map(result => (
                    <div key={result.name} className="bg-white text-center shadow-md p-6 rounded-lg">
                        <img src={result.profileImage} alt={result.name} className=" w-28 h-28 rounded-full mx-auto mb-4" />
                        <h3 className="text-lg font-semibold mb-2">{result.name}</h3>
                        <p className="text-gray-600 text-sm mb-2">Class of {result.graduationYear}</p>
                        <p className="text-gray-600 text-sm mb-2">{result.occupation}</p>
                        <p className="text-gray-600 text-sm">{result.location}</p>
                    </div>
                ))}
            </div>
        </div>
    </section>
    );
}

export default OverPastResult
